import './App.css';
import {BrowserRouter} from "react-router-dom";
import Header from "./components/Header/header";
import Navbar from "./components/Navbar/nav-bar";
import Tools from "./components/Tools/Tools";

function App(props) {
    return (
        <BrowserRouter>
            <div className="container">
                <Header/>
                <Navbar addressElement={props.addressElement}/>
                <div className="container-content">
                    <Tools postData={props.state.postData} messageData={props.messageData} friendData={props.state.friendData}/>
                </div>
            </div>
        </BrowserRouter>
    );
}

export default App;
